class Submission:
    def __init__(self, submission_id: str, user: User, data: Dict):
        self.submission_id = submission_id
        self.user = user
        self.data = data
        self.status = "draft"
        self.errors = []
        self.timestamp = datetime.datetime.now()

    def validate(self, rules: List[ValidationRule]) -> bool:
        """Validate submission against a list of rules."""
        self.errors = []
        for rule in rules:
            if not rule.apply(self.data):
                self.errors.append(rule.error_message)
        return len(self.errors) == 0

    def publish(self) -> bool:
        """Publish the submission if valid."""
        if self.status != "draft":
            return False
        self.status = "published"
        return True

