# Cluster 0: Validation and Error Handling
class ValidationManager:
    def __init__(self, db: Database):
        self.db = db
        self.rules = self._load_rules()

    def _load_rules(self) -> List[ValidationRule]:
        """Load validation rules from the database."""
        rules_data = self.db.query("SELECT rule_id, description, error_message FROM validation_rules")
        return [ValidationRule(**rule) for rule in rules_data]

    def validate_submission(self, submission: Submission) -> bool:
        """Validate a submission against all rules."""
        return submission.validate(self.rules)

    def update_rule(self, rule_id: str, new_description: str, new_error_message: str) -> bool:
        """Update a validation rule."""
        for rule in self.rules:
            if rule.rule_id == rule_id:
                rule.description = new_description
                rule.error_message = new_error_message
                return True
        return False

# Cluster 1: File Generation and Data Management
class FileGenerator:
    def __init__(self, db: Database):
        self.db = db

    @lru_cache(maxsize=128)
    def generate_d_file(self, request_id: str) -> Optional[str]:
        """Generate a D file with caching to prevent duplicates."""
        data = self.db.query("SELECT * FROM submissions WHERE request_id = %(request_id)s", {"request_id": request_id})
        if not data:
            return None
        # Placeholder for actual file generation logic
        return f"D_file_{request_id}.csv"

    def sync_with_fpds(self) -> bool:
        """Sync D1 file generation with FPDS data load."""
        fpds_data = self.db.query("SELECT MAX(load_date) FROM fpds_data")
        if not fpds_data:
            return False
        last_load_date = fpds_data[0]["max"]
        # Check if data has been updated since last generation
        recent_submissions = self.db.query(
            "SELECT COUNT(*) FROM submissions WHERE modified_date > %(last_load_date)s",
            {"last_load_date": last_load_date}
        )
        return recent_submissions[0]["count"] > 0

# Cluster 2: FABS and FPDS Data Processing
class FABSProcessor:
    def __init__(self, db: Database):
        self.db = db

    def process_historical_data(self, include_frec: bool = True) -> bool:
        """Process historical FABS data, optionally including FREC derivations."""
        historical_data = self.db.query("SELECT * FROM historical_fabs")
        for record in historical_data:
            # Placeholder for actual processing logic
            if include_frec:
                record["frec_derived"] = self._derive_frec(record)
            self.db.update("published_award_financial_assistance", record)
        return True

    def _derive_frec(self, record: Dict) -> str:
        """Derive FREC code from record data."""
        # Placeholder for actual derivation logic
        return "FREC_" + record.get("agency_code", "UNKNOWN")

    def update_gtas_window(self, start_date: str, end_date: str) -> bool:
        """Update GTAS window data in the database."""
        return self.db.update(
            "system_settings",
            {"gtas_window_start": start_date, "gtas_window_end": end_date},
            "setting_name = 'gtas_window'"
        )

# Cluster 3: Agency User Requirements
class AgencyService:
    def __init__(self, db: Database):
        self.db = db

    def get_submission_period(self) -> Dict[str, str]:
        """Get the current submission period start and end dates."""
        period = self.db.query("SELECT start_date, end_date FROM submission_periods ORDER BY start_date DESC LIMIT 1")
        return period[0] if period else {}

    def validate_zip(self, zip_code: str, require_full: bool = False) -> bool:
        """Validate ZIP code, optionally requiring full ZIP+4."""
        if require_full and len(zip_code.replace("-", "")) != 9:
            return False
        return len(zip_code.replace("-", "")) >= 5

    def format_file_f(self, data: List[Dict]) -> str:
        """Format data as File F with proper quoting."""
        # Placeholder for actual formatting logic
        return "\n".join([f'"{value}"' for item in data for value in item.values()])

